import React from "react";

class Button extends React.Component {
    render() {
        return (
            <div>
                <button
                    className="button minus"
                    onClick={() => this.props.countFunc(0)}
                >
                    - Minus
                </button>
                <button
                    className="button plus"
                    onClick={() => this.props.countFunc(1)}
                >
                    + Plus
                </button>
            </div>
        );
    }
}

export default Button;
